import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

import store, { history } from './redux/configureStore';

ReactDOM.render(
    <Provider store={store}>
        <ConnectedRouter history={history}>
            <App />
        </ConnectedRouter>
    </Provider>,
    document.getElementById("root")
);
